import React from 'react'
import BlogInfo from './BlogInfo'
import { BrowserRouter as Router, Route, Link } from 'react-router-dom'


const Blog = ({ blog }) => {

    const blogStyle = {
        paddingTop: 10,
        paddingLeft: 2,
        border: 'solid',
        borderWidth: 1,
        marginBottom: 5
    }

    return(
        <div style={blogStyle}>
            {blog.title}
        </div>
    )
}


export default Blog
